    "Drag the items onto the image above.": "Dr\u00e4g th\u00e9 \u00eft\u00e9ms \u00f6nt\u00f6 th\u00e9 \u00efm\u00e4g\u00e9 \u00e4\u00df\u00f6v\u00e9. \u2c60'\u03c3\u044f\u0454\u043c \u03b9\u03c1\u0455\u03c5\u043c \u2202\u03c3\u0142\u03c3\u044f \u0455\u03b9\u0442 \u03b1\u043c\u0454\u0442, \u00a2\u03c3\u03b7\u0455\u0454\u00a2\u0442\u0454\u0442\u03c5#",
